import React from 'react';
import { Link } from 'react-router-dom';
import { FaDollarSign } from 'react-icons/fa'; // Importing the dollar sign icon from react-icons/fa

const Header: React.FC = () => {
  return (
    <header className="app-header">
      <div className="app-title">
        <FaDollarSign size={24} style={{ marginRight: '10px' }} /> {/* Dollar sign icon */}
        <h1 className="app-title-text">Finance Tracker</h1> {/* Title with reduced boldness */}
      </div>
      <nav className="nav-links">
        <ul>
          <li><Link to="/">Dashboard</Link></li>
          <li><Link to="/reports">Reports</Link></li>
          <li><Link to="/settings">Settings</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
